import React from 'react';



const  Footer = () => {

        return   (       
        <div className="main-footer">
                 <div className="container">
                     <div className="row">
                         {/* colum1 */}
                         <div className="col">
                             <h4><a href="/">Home</a></h4>

                         </div>
                         {/* colum2 */}
                         <div className="col">
                        <h4>The adress</h4>
                        <ul className="list-unstyled">
                             <li>1129</li>
                             <li>Stockholm, Sweeden</li>
                            <li>Åsögatan 79</li>
                            </ul>
                         </div>
                         <hr />
                         {/* colum3 */}
                         <div className="row">
                             <p className="col-sm">
                                 &copy;{new Date().getFullYear()} by Silvia | Portfolio | All right reservate
                             </p>

                         </div>

         </div>
        </div>            
        </div>
    );

}

export default Footer;
